import React, { useState, useEffect } from 'react';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import { FiActivity, FiShield, FiWifi, FiCpu, FiSettings, FiMonitor, FiSun, FiMoon } from 'react-icons/fi';
import Header from './Header';
import PlayfairTab from './tabs/PlayfairTab';
import RIPTab from './tabs/RIPTab';
import TCPTab from './tabs/TCPTab';
import SimulationTab from './tabs/SimulationTab';
import NetworkVisualization from './NetworkVisualization';
import SettingsTab from './tabs/SettingsTab';
import './Dashboard.css';

const Dashboard = () => {
  const [systemStats, setSystemStats] = useState({
    cpu: 45,
    memory: 62,
    network: 78,
    status: 'Online'
  });

  const [darkMode, setDarkMode] = useState(true);

  useEffect(() => {
    document.documentElement.setAttribute('data-theme', darkMode ? 'dark' : 'light');
  }, [darkMode]);

  useEffect(() => {
    const interval = setInterval(() => {
      setSystemStats(prev => ({
        ...prev,
        cpu: Math.floor(Math.random() * 40) + 30,
        memory: Math.floor(Math.random() * 30) + 50,
        network: Math.floor(Math.random() * 40) + 60
      }));
    }, 3000);

    return () => clearInterval(interval);
  }, []);

  const toggleTheme = () => {
    setDarkMode(!darkMode);
  };

  return (
    <div className={`dashboard-container ${darkMode ? 'dark-theme' : 'light-theme'}`}>
      <Header systemStats={systemStats} />

      <div className="dashboard-content">
        <div className="dashboard-header">
          <div className="header-info">
            <h1>Network Simulation Control Center</h1>
            <p>Advanced network protocols simulation and analysis platform</p>
          </div>
          <button className="theme-toggle" onClick={toggleTheme}>
            {darkMode ? <FiSun /> : <FiMoon />}
            {darkMode ? 'Light Mode' : 'Dark Mode'}
          </button>
        </div>

        <Tabs className="dashboard-tabs" selectedTabClassName="active-tab">
          <div className="tabs-layout">
            <TabList className="tab-list">
              <Tab className="tab-item">
                <FiMonitor className="tab-icon" />
                <span>Overview</span>
              </Tab>
              <Tab className="tab-item">
                <FiShield className="tab-icon" />
                <span>Playfair Cipher</span>
              </Tab>
              <Tab className="tab-item">
                <FiWifi className="tab-icon" />
                <span>RIP Routing</span>
              </Tab>
              <Tab className="tab-item">
                <FiActivity className="tab-icon" />
                <span>TCP Reno</span>
              </Tab>
              <Tab className="tab-item">
                <FiCpu className="tab-icon" />
                <span>Full Simulation</span>
              </Tab>
              <Tab className="tab-item">
                <FiSettings className="tab-icon" />
                <span>Settings</span>
              </Tab>
            </TabList>

            <div className="tab-panels">
              <TabPanel>
                <div className="tab-panel-content">
                  <NetworkVisualization />
                </div>
              </TabPanel>

              <TabPanel>
                <div className="tab-panel-content">
                  <PlayfairTab />
                </div>
              </TabPanel>

              <TabPanel>
                <div className="tab-panel-content">
                  <RIPTab />
                </div>
              </TabPanel>

              <TabPanel>
                <div className="tab-panel-content">
                  <TCPTab />
                </div>
              </TabPanel>

              <TabPanel>
                <div className="tab-panel-content">
                  <SimulationTab />
                </div>
              </TabPanel>

              <TabPanel>
                <div className="tab-panel-content">
                  <SettingsTab darkMode={darkMode} toggleTheme={toggleTheme} />
                </div>
              </TabPanel>
            </div>
          </div>
        </Tabs>
      </div>
    </div>
  );
};

export default Dashboard;
